import React, { Component } from 'react'
import PropTypes from 'prop-types'

export class TodoItem extends Component {
  render() {
    return (
      <div style={{itemStyle}}>
        <p>{this.props.todo.title}</p>
      </div>
    )
  }
}
TodoItem.propTypes = {
    todos: PropTypes.object.isRequired
}
const itemStyle = {
    backgroundColor: 'red'
}

export default TodoItem
